import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

import IngredientesScreen from './screens/IngredientesScreen';
import AbmIngredientesScreen from './screens/abmIngredientesScreen';

const Stack = createStackNavigator();

const Navigation = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Ingredientes" component={AbmIngredientesScreen} />
        <Stack.Screen name="ABM Ingredientes" component={AbmIngredientesScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default Navigation;
